import React from "react";

function PopUp({ getPopUpData, apiDataP }) {
  return (
    <div className="overlay">
      <div className="popup"

      >
        <button className="close" onClick={(e) => getPopUpData(e)}>
          x
        </button>
        <img className="img" src={apiDataP.urls.small} alt="img"></img>
        <div className="popup-contents">
            {apiDataP.user.username}
            {apiDataP.user.name}
            {apiDataP.likes}
            {apiDataP.instagram_username}
            {apiDataP.twitter_username}
        </div>  
      </div>
    </div>
  );
}

export default PopUp;
